import Link from 'next/link';
import { GoSearch } from 'react-icons/go';

const linkStyle = {
  fontSize: 35
};

const Header = () => (

  <nav className="navbar navbar-expand-sm bg-light navbar-light">
    <Link href="/">
      <a className="navbar-brand" style={linkStyle}>Les recettes de Martine</a>
    </Link>
    <ul className="navbar-nav">
      <li className="nav-item">
        <Link href="/about">
          <button className="btn-success">Ajouter une recette </button>
        </Link>
      </li>
      <li className="nav-item">
        <Link href="/">
          <a className="nav-link"><GoSearch /> Rechercher</a>
        </Link>
      </li>
      <li className="nav-item">
        <Link href="/">
          <a className="nav-link">Profil</a>
        </Link>
      </li>
    </ul>
  </nav>

);


export default Header;
